from typing import List

class Solution:
    def kWeakestRows(self, mat: List[List[int]], k: int) -> List[int]:
        rows = len(mat)
        res = list()
        for r in range(rows):
            lst = mat[r]
            res.append((r, lst.count(1)))
        res = sorted(res, key=lambda x: (x[1], x[0]))
        return [x for x, y in res[:k]]

